import React from "react";
import { Formik, Form } from "formik";
import { Container, Grid, Input, Button } from "@material-ui/core";
import Upload from "./Form";

function App() {
  return (
    <div className='App'>
      <Container>
        <Grid>
          <Formik
            initialValues={{ file: "" }}
            onSubmit={async (values) => {
              console.log(JSON.stringify(values[1]));
              let data = new FormData();
              await data.append("file", values.file);
              console.log(data);
            }}
          >
            {(formProps) => (
              <Form>
                <Grid>
                  <Upload file={"file"} formProps={formProps} />
                </Grid>
                <Grid>
                  <Upload file={"file2"} formProps={formProps} />
                </Grid>
                <Button type='submit'>Submit</Button>
              </Form>
            )}
          </Formik>
        </Grid>
      </Container>
    </div>
  );
}

export default App;
